import { Layout, Menu } from 'antd';
import React from 'react';
import './Layout.css';

const { Header, Footer, Content, Sider } = Layout;

const Layouts = (props) => {
    return (
        <>
            <Layout>

                <Header className='header'>

                </Header>

                <Content>{props.children}</Content>

                <Footer>Footer</Footer>

            </Layout>
        </>
    )
}
export default Layouts;
